import React from 'react';
import './Contact.css';

function Contact() {
  return (
    <div className="contactmain">
      <div className="contact-header">
        <h1>Contact Us</h1>
        <p>We'd love to hear from you. Please fill out the form below to get in touch.</p>
      </div>
      <div className='form'>
        <center></center>
      </div>

    </div>
  );
}

export default Contact;
